(49, 'Cho thuê nhà đất DT 450m2 số 39 Nguyễn Xuân Linh - P. Đông Vĩnh - Tp. Vinh', 'Cho-thue-nha-dat-DT-450m2-so-39-Nguyen-Xuan-Linh---P.-Dong-Vinh---Tp.-Vinh', 28, 295, 5258, 'Nguyễn Xuân Linh', '39', 4500000, 450, '<p>Đối diện trường Mầm Non Đ&ocirc;ng Vĩnh, DT: 450m&sup2;. Trong DT nh&agrave; 180m&sup2; tho&aacute;ng m&aacute;t, nh&agrave; 2 mặt tiền, mặt tiền ch&iacute;nh 28m, đường nhựa 8m vỉa h&egrave; 1 b&ecirc;n 1m, b&ecirc;n 3m.</p>\r\n\r\n<p>Vị tr&iacute; thuận tiện gần trung t&acirc;m TP, gần trường cấp 1, s&acirc;n b&oacute;ng, tho&aacute;ng m&aacute;t ph&ugrave; hợp để ở, l&agrave;m văn ph&ograve;ng, kinh doanh, hay l&agrave;m kho h&agrave;ng.<br />\r\n<br />\r\nCho thu&ecirc; l&acirc;u d&agrave;i.<br />\r\nGi&aacute; 4,5tr/ th&aacute;ng.<br />\r\nCọc 2 th&aacute;ng tiền thu&ecirc;.</p>\r\n', './image/upload/1-1.jpg', 5, '2023-04-27 00:07:09', '2023-07-30 00:07:09', '1', 2, 26, 2, '2023-04-26 17:07:09', '2023-04-26 17:07:09'),
(50, 'Chính chủ cần cho thuê nhà 3 tầng mặt phố, Phong Đinh Cảng, phường Bến Thuỷ, TP. Vinh, Nghệ An', 'Chinh-chu-can-cho-thue-nha-3-tang-mat-pho--Phong-Dinh-Cang--phuong-Ben-Thuy--TP.-Vinh--Nghe-An', 28, 295, 5270, 'Phong Đình Cảng', '32', 6000000, 80, '<p>Nh&agrave; mặt phố:<br />\r\nĐịa chỉ : Số 32 đường Phong Đinh Cảng, phường Bến Thuỷ tp Vinh nghệ an<br />\r\n+ Vị tr&iacute; nh&agrave; đẹp, Kh&ocirc;ng gian tho&aacute;ng m&aacute;t. Mặt đường V&otilde; Th&uacute;c Đồng, đ&ocirc;ng người qua lại,dọc tuyến phố kh&aacute; nhiều h&agrave;ng qu&aacute;n, tiện cho việc kinh doanh<br />\r\n+ Đường rộng, giao th&ocirc;ng thuận tiện, an ninh tốt<br />\r\n+ Nh&agrave; đẹp, Thiết kế 3 tầng lệch. Ph&iacute;a sau c&oacute; khoảng vườn DT 30m&sup2; (c&oacute; lối đi ri&ecirc;ng, d&agrave;nh l&agrave;m kho hoặc gara... )<br />\r\n+ Th&iacute;ch hợp cho thu&ecirc; l&agrave;m văn ph&ograve;ng đại diện hoặc kinh doanh.</p>\r\n', './image/upload/2-2.jpg', 4, '2023-04-27 00:08:10', '2023-07-30 00:08:10', '1', 2, 26, 2, '2023-04-26 17:08:10', '2023-04-26 17:08:10'),
(51, 'CHO THUÊ NHÀ 2 TẦNG KIÊN CỐ MẶT TIỀN', 'CHO-THUE-NHA-2-TANG-KIEN-CO-MAT-TIEN', 28, 295, 5261, 'Mai Hắc Đế', '25', 7000000, 70, '<p><span style=\"font-size:12pt\">CHO THU&Ecirc; NH&Agrave; 2 TẦNG KI&Ecirc;N CỐ</span></p>\r\n\r\n<p><span style=\"font-size:12pt\">- Nh&agrave; sạch sẽ, oto để trước nh&agrave;</span></p>\r\n\r\n<p><span style=\"font-size:12pt\">- 3 ph&ograve;ng ngủ, 2 vệ sinh</span></p>\r\n\r\n<p><span style=\"font-size:12pt\">- Mặt dường, c&aacute;ch chợ vinh 800m</span></p>\r\n\r\n<p><span style=\"font-size:12pt\">- Ph&ugrave; hợp vừa ở vừa kinh doanh:&nbsp; văn ph&ograve;ng, kho, b&aacute;n h&agrave;ng</span></p>\r\n\r\n<p><span style=\"font-size:12pt\">- Đường rộng 10m</span></p>\r\n\r\n<p><span style=\"font-size:12pt\">- Di&ecirc;n t&iacute;ch 70m2</span></p>\r\n\r\n<p><span style=\"font-size:12pt\">- Mặt tiền 7m</span></p>\r\n', './image/upload/3-1.jpg', 4, '2023-04-27 00:08:28', '2023-07-30 00:08:28', '1', 2, 26, 2, '2023-04-26 17:08:28', '2023-04-26 17:08:28'),
