(53, 'CHO THUÊ NHÀ 4 TẦNG PHÙ HỢP MỞ SPA, VĂN PHÒNG, TRUNG TÂM GIA SƯ', 'CHO-THUE-NHA-4-TANG-PHU-HOP-MO-SPA--VAN-PHONG--TRUNG-TAM-GIA-SU', 2, 7, 67, 'Nguyễn Chí Thanh', '122', 15000000, 100, '<p><span style=\"font-size:12pt\">CHO THU&Ecirc; NH&Agrave; 4 TẦNG PH&Ugrave; HỢP MỞ SPA, VĂN PH&Ograve;NG, TRUNG T&Acirc;M GIA SƯ</span></p>\r\n\r\n<p><span style=\"font-size:12pt\">📌&nbsp; Diện t&iacute;ch 100m2, mặt tiền 6m</span></p>\r\n\r\n<p><span style=\"font-size:12pt\">📌&nbsp; Tầng 1 th&ocirc;ng, bếp, wc</span></p>\r\n\r\n<p><span style=\"font-size:12pt\">📌&nbsp; Tầng 2 1pn to, wc</span></p>\r\n\r\n<p><span style=\"font-size:12pt\">📌&nbsp; Tầng 3 c&oacute; 2pn , wc</span></p>\r\n\r\n<p><span style=\"font-size:12pt\">📌&nbsp; Tầng 4 thờ v&agrave; s&acirc;n</span></p>\r\n', './image/upload/5-1.jpg', 3, '2023-04-27 00:09:21', '2023-08-06 00:09:21', '1', 2, 26, 2, '2023-04-26 17:09:21', '2023-04-26 17:09:21'),
(54, 'CẦN CHO THUÊ NHÀ RIÊNG SAU KHÁCH SẠN XANH', 'CAN-CHO-THUE-NHA-RIENG-SAU-KHACH-SAN-XANH', 28, 295, 5261, 'Mai Hắc Đế', 'Nhà số 10,hẻm 1, ngõ 2', 4500000, 32, '<p><span style=\"font-size:12pt\">CẦN CHO THU&Ecirc; NH&Agrave; RI&Ecirc;NG SAU KH&Aacute;CH SẠN XANH</span></p>\r\n\r\n<p><span style=\"font-size:12pt\">- Diện t&iacute;ch ~ 32 m2</span></p>\r\n\r\n<p><span style=\"font-size:12pt\">- Nh&agrave; c&oacute; ph&ograve;ng ngủ, ph&ograve;ng kh&aacute;ch, ph&ograve;ng bếp v&agrave; vệ sinh. Vừa sơn v&agrave; sửa lại sạch sẽ, tho&aacute;ng m&aacute;t (Nh&agrave; kh&ocirc;ng bao gồm đồ đạc)</span></p>\r\n\r\n<p><span style=\"font-size:12.0pt\">- Ưu ti&ecirc;n thu&ecirc; l&acirc;u d&agrave;i.</span></p>\r\n', './image/upload/313975471-910599500325495-5013011573791513342-n.jpg', 3, '2023-04-27 00:09:45', '2023-07-30 00:09:45', '1', 2, 26, 2, '2023-04-26 17:09:45', '2023-04-26 17:09:45'),
(55, 'Cho thuê nhà 2 tầng phường lê mao siêu đẹp', 'Cho-thue-nha-2-tang-phuong-le-mao-sieu-dep', 28, 295, 5268, 'Lê Mao', '12', 7000000, 120, '<p><span style=\"font-size:12pt\">Cho thu&ecirc; nh&agrave; 2 tầng phường l&ecirc; mao si&ecirc;u đẹp</span></p>\r\n\r\n<p><span style=\"font-size:12pt\">- Ph&ugrave; hợp hộ gia đ&igrave;nh, gần trường tiểu học l&ecirc; mao, bệnh viện, quảng trường, chợ vinh</span></p>\r\n\r\n<p><span style=\"font-size:12pt\">- Diện tich: 120m2/s&agrave;n</span></p>\r\n\r\n<p><span style=\"font-size:12pt\">- Tầng 1 gara &ocirc; t&ocirc; </span></p>\r\n\r\n<p><span style=\"font-size:12pt\">- Tầng 2 v&agrave; 3 tổng gồm c&oacute; 3 ph&ograve;ng,</span></p>\r\n\r\n<p><span style=\"font-size:12.0pt\">- C&oacute; điều ho&agrave;, n&oacute;ng lạnh một số nội thất cơ bản</span></p>\r\n', './image/upload/314892485-1274550106669525-2172823587855498392-n.jpg', 2, '2023-04-27 00:10:10', '2023-08-13 00:10:10', '1', 2, 26, 2, '2023-04-26 17:10:10', '2023-04-26 17:10:10'),
(56, 'CHO THUÊ NHÀ NGUYÊN CĂN giá cả hợp lý', 'CHO-THUE-NHA-NGUYEN-CAN-gia-ca-hop-ly', 28, 295, 5262, 'Vĩnh Yên', '1', 6100000, 70, '<p><span style=\"font-size:12pt\">CHO THU&Ecirc; NH&Agrave; NGUY&Ecirc;N CĂN gi&aacute; cả hợp l&yacute;</span></p>\r\n\r\n<p><span style=\"font-size:12pt\">🏡 Nh&agrave; nguy&ecirc;n căn 70m2:</span></p>\r\n\r\n<p><span style=\"font-size:12pt\">-&nbsp; 1 ph&ograve;ng kh&aacute;ch, 2 ph&ograve;ng ngủ, 1 ph&ograve;ng sinh hoạt chung, 1 g&aacute;c, 1 ph&ograve;ng bếp, 1 ph&ograve;ng tắm, WC. (S&acirc;n trước c&oacute; thể kinh doanh tạp h&oacute;a).</span></p>\r\n\r\n<p><span style=\"font-size:12pt\">- Ph&ugrave; hợp cho gia đ&igrave;nh, c&aacute;c nh&oacute;m sinh vi&ecirc;n,..</span></p>\r\n\r\n<p><span style=\"font-size:12.0pt\">- Tản bộ v&agrave;i bước ch&acirc;n l&agrave; đến phố đi bộ v&agrave; quảng trường Nghệ An</span></p>\r\n', './image/upload/317273839-2208717419288940-642282747377241766-n.jpg', 2, '2023-04-26 00:11:03', '2023-07-30 00:11:03', '1', 2, 26, 2, '2023-04-26 17:11:03', '2023-04-26 17:11:03'),
(57, 'CHO THUÊ NHÀ NGUYÊN CĂN RỘNG RÃI, THOÁNG MÁT, TIỆN KINH DOANH ONLINE', 'CHO-THUE-NHA-NGUYEN-CAN-RONG-RAI--THOANG-MAT--TIEN-KINH-DOANH-ONLINE', 28, 295, 5265, 'Phạm Ngũ Lão', '12', 8500000, 56, '<p>Cho thu&ecirc; nh&agrave; rộng r&atilde;i,tiện kinh doanh online hay để ở</p>\r\n\r\n<p>Diện t&iacute;ch: 4*14m=56m2 .</p>\r\n\r\n<p>Một trệt,một lửng. 2ph&ograve;ng,2 m&aacute;y lạnh ,2 tolet. 1 sofa ,1 tủ quần &aacute;o,1 b&agrave;n trang điểm,1 tủ để gi&agrave;y.</p>\r\n\r\n<p>Nh&agrave; mới khang trang sạch sẽ. Gần cầu Nguyễn văn cừ,thuận tiện di chuyển qua quận 1,3,5,10,gần trường học ,chợ,bệnh viện,si&ecirc;u thị. Khu vực an ninh,sạch sẽ .</p>\r\n\r\n<p>Cọc 2th&aacute;ng tiền nh&agrave;</p>\r\n', './image/upload/45-4.jpg', 1, '2023-04-27 00:11:21', '2023-07-30 00:11:21', '1', 2, 26, 2, '2023-04-26 17:11:21', '2023-04-26 17:11:21'),
(58, 'Cho thuê nhà ở cho hộ gia đình 60m2', 'Cho-thue-nha-o-cho-ho-gia-dinh-60m2', 28, 295, 5270, 'Nguyễn Du', '137', 6200000, 60, '<p><span style=\"font-size:12pt\">Cho thu&ecirc; nh&agrave; ở cho hộ gia đ&igrave;nh 60m2</span></p>\r\n\r\n<p><span style=\"font-size:12pt\">- Diện t&iacute;ch cho thu&ecirc; ~ 60m2, 2 tầng, 2 mặt tiền</span></p>\r\n\r\n<p><span style=\"font-size:12pt\">- Bao gồm: 1 ph&ograve;ng kh&aacute;ch, 3 ph&ograve;ng trống ( diện t&iacute;ch tương ứng ~30m2, 25m2 v&agrave; 15m2) </span></p>\r\n\r\n<p><span style=\"font-size:12pt\">- Kh&ocirc;ng bao gồm cơ sở vật chất trong h&igrave;nh </span></p>\r\n\r\n<p><span style=\"font-size:12pt\">- Vị tr&iacute; trung t&acirc;m của th&agrave;nh phố,c&aacute;chtrường đại học vinh gần 500m, khu an ninh , sạch sẽ v&agrave; c&oacute; s&acirc;n rộng </span></p>\r\n\r\n<p><span style=\"font-size:12pt\">- Ph&ugrave; hợp mở cửa h&agrave;ng tạp ho&aacute;, văn ph&ograve;ng, nh&agrave; ở, trung t&acirc;m lớp học,.....</span></p>\r\n\r\n<p><span style=\"font-size:12.0pt\">- C&oacute; thể chuyển v&agrave;o ngay từ b&acirc;y giờ</span></p>\r\n', './image/upload/5-2.jpg', 1, '2023-04-27 00:12:49', '2023-07-30 00:12:49', '1', 2, 26, 2, '2023-04-26 17:12:49', '2023-04-26 17:12:49'),
(59, 'Cho thuê phòng trọ khép kín không chung cổng chủ', 'Cho-thue-phong-tro-khep-kin-khong-chung-cong-chu', 28, 295, 5267, 'Nguyễn Thái Học', '26', 750000, 22, '<p><span style=\"font-size:12pt\">Cho thu&ecirc; ph&ograve;ng trọ kh&eacute;p k&iacute;n kh&ocirc;ng chung cổng chủ</span></p>\r\n\r\n<p><span style=\"font-size:12pt\">- Nh&agrave; trọ 4 tầng, sạch sẽ, rộng r&atilde;i</span></p>\r\n\r\n<p><span style=\"font-size:12pt\">- Chỗ để xe rộng</span></p>\r\n\r\n<p><span style=\"font-size:12pt\">- C&oacute; s&acirc;n phơi ở tầng thượng</span></p>\r\n\r\n<p><span style=\"font-size:12pt\">- Kh&ocirc;ng chung cổng chủ</span></p>\r\n\r\n<p><span style=\"font-size:12pt\">- Gần trường tiểu học Đội Cung</span></p>\r\n\r\n<p><span style=\"font-size:12pt\">- Điện 3k/số. Nước 10k/số</span></p>\r\n', './image/upload/cach-trang-tri-phong-tro-de-thuong.jpg', 1, '2023-04-30 10:27:29', '2023-07-30 10:27:29', '3', 2, 23, 1, '2023-05-01 16:18:36', '2023-05-01 16:18:36'),
(60, 'Cần tìm 1 bạn nam ở ghép trong phòng trọ đầy đủ tiện nghi', 'Can-tim-1-ban-nam-o-ghep-trong-phong-tro-day-du-tien-nghi', 28, 295, 5262, 'Trường Tiến', '86', 1230000, 26, '<p>Hiện tại ph&ograve;ng c&oacute; 2 người Đầu th&aacute;ng 12 or hiện tại c&oacute; thể dọn v&agrave;o ở</p>\r\n\r\n<p>- Tiền Ph&ograve;ng : 3700k _ CỌC PH&Ograve;NG :1230k (3700k)</p>\r\n\r\n<p>- Điện: 3.7k/KW - Nước: 20k/khối</p>\r\n\r\n<p>- Xe: 150 k /xe</p>\r\n\r\n<p>- Vệ sinh, wifi, r&aacute;c : 100k Ph&ograve;ng</p>\r\n\r\n<p>- giờ giấc tự do.</p>\r\n\r\n<p>Hiện tại ph&ograve;ng đ&atilde; c&oacute; đầy đủ đồ đạc : bếp, quạt, tủ lạnh ,nồi ni&ecirc;u ,m&aacute;y giặt ri&ecirc;ng (kh&ocirc;ng c&oacute; m&aacute;y lạnh) Ưu ti&ecirc;n &iacute;t đồ đạc.</p>\r\n', './image/upload/315660963-3314613072127347-8199489280806102377-n.jpg', 5, '2023-04-30 10:35:24', '2023-08-27 10:35:24', '2', 2, 23, 5, '2023-04-30 03:35:24', '2023-04-30 03:35:24'),
(61, 'Tìm bạn ở ghép (Nữ, LGBTQ+) trong phòng trọ quận Tân Phú', 'Tim-ban-o-ghep--Nu--LGBTQ---trong-phong-tro-quan-Tan-Phu', 51, 558, 8794, 'Vườn Lài', '16', 1200000, 26, '<p>Nguyễn Minh T&acirc;n (Năm 4, Văn Học, ĐHSP), t&igrave;m bạn ở gh&eacute;p.</p>\r\n\r\n<p>170/1, Vườn L&agrave;i, T&acirc;n Ph&uacute;.</p>\r\n\r\n<p>Gi&aacute; ph&ograve;ng: 1m - 1m5</p>\r\n\r\n<p>Điện: 3,5k</p>\r\n\r\n<p>Nước: 20k</p>\r\n\r\n<p>Dịch vụ: 40K (R&aacute;c, wifi, gửi xe, qu&eacute;t dọn)</p>\r\n\r\n<p>Ph&ograve;ng trọ c&oacute; mở kh&oacute;a v&acirc;n tay, gần ĐH Văn Hiến,....</p>\r\n\r\n<p>Chủ ph&ograve;ng c&oacute; thể phổ cặp chương tr&igrave;nh Ngữ Văn ở c&aacute;c cấp (Miễn ph&iacute;), c&aacute;c kiến thức về skincare, chăm s&oacute;c sức khỏe, tư vấn t&acirc;m l&yacute; t&igrave;nh y&ecirc;u tuổi mới lớn, kinh nghiệm đăng k&yacute; học phần cho t&acirc;n sinh vi&ecirc;n, l&agrave;m bi&ecirc;n tập vi&ecirc;n (Miễn ph&iacute;) cho c&aacute;c t&aacute;c giả muốn xuất bản s&aacute;ch, lan tỏa năng lượng sống l&agrave;nh mạnh,...</p>\r\n', './image/upload/thiet-ke-noi-that-phong-tro-38.jpg', 4, '2023-04-30 10:35:43', '2023-08-27 10:35:43', '3', 2, 23, 5, '2023-04-30 03:35:43', '2023-04-30 03:35:43'),
(63, 'CHO THUÊ PHÒNG TRỌ KHÉP KÍN KHÔNG CHUNG CỔNG CHỦ', 'CHO-THUE-PHONG-TRO-KHEP-KIN-KHONG-CHUNG-CONG-CHU', 28, 295, 5259, 'Hưng Bình', '80', 1500000, 25, '<p>Cho thu&ecirc; ph&ograve;ng trọ kh&eacute;p k&iacute;n kh&ocirc;ng chung cổng chủ</p>\r\n\r\n<p>- Nh&agrave; trọ 4 tầng, sạch sẽ, rộng r&atilde;i</p>\r\n\r\n<p>- Chỗ để xe rộng</p>\r\n\r\n<p>- C&oacute; s&acirc;n phơi ở tầng thượng</p>\r\n\r\n<p>- Kh&ocirc;ng chung cổng chủ</p>\r\n\r\n<p>- Gần trường tiểu học Đội Cung</p>\r\n\r\n<p>- Điện 3k/số. Nước 10k/số</p>\r\n', './image/upload/1-2.jpg', 1, '2023-03-24 12:04:50', '2023-05-29 12:04:50', '1', 2, 25, 1, '2023-03-24 05:04:50', '2023-03-24 05:04:50'),
(64, 'Cho thuê căn hộ giá rẻ tại đường kim đồng', 'Cho-thue-can-ho-gia-re-tai-duong-kim-dong', 28, 295, 5262, 'Kim Đồng', '32', 3500000, 45, '<p>CHO THU&Ecirc; CĂN HỘ VIEW ĐẸP 2 PH&Ograve;NG NGỦ</p>\r\n\r\n<p>? Căn hộ 2 ph&ograve;ng ngủ, 2WC ( ban c&ocirc;ng lớn xịn s&ograve; , wiu tho&aacute;ng m&aacute;t )</p>\r\n\r\n<p>? full nội thất mới đầy đủ tiện nghi</p>\r\n\r\n<p>? Khu an ninh y&ecirc;n tĩnh bảo vệ 24/24, c&oacute; b&atilde;i xe rộng</p>\r\n', './image/upload/11.jpg', 1, '2023-04-13 23:21:44', '2023-06-18 23:21:44', '2', 2, 25, 3, '2023-04-13 16:21:44', '2023-04-13 16:21:44'),
(65, 'Cho thuê nhà mặt tiền đường Mai Hắc Đế', 'Cho-thue-nha-mat-tien-duong-Mai-Hac-De', 28, 295, 5261, 'Mai Hắc Đế', '5', 20000000, 500, '<p>Cho thu&ecirc; nh&agrave; nguy&ecirc;n căn</p>\r\n\r\n<p>Diện t&iacute;ch sử dụng: 500m2 - Diện t&iacute;ch đất: 125m2. Đường 60m</p>\r\n\r\n<p>Kết cấu: 4 Tầng, 10 Ph&ograve;ng ngủ, 1 ph&ograve;ng kh&aacute;ch lớn 60m2, 2 bếp, 8 Wc, 2 s&acirc;n thượng Trước v&agrave; Sau</p>\r\n\r\n<p>+ Tầng 1 ( 125m2): c&oacute; 1 bếp lớn, 1 ph&ograve;ng ngủ, 2 nh&agrave; vệ sinh</p>\r\n\r\n<p>+ Tầng 2: ( 125m2) Trước c&oacute; 2 ph&ograve;ng ngủ v&agrave; 2 nh&agrave; vệ sinh ri&ecirc;ng từng ph&ograve;ng; Sau c&oacute; 2 ph&ograve;ng ngủ chung 1 nh&agrave; vệ sinh.</p>\r\n\r\n<p>+ Tầng 3 ( 125m2): Trước 2 ph&ograve;ng ngủ chung 1 nh&agrave; vệ sinh; Sau 1 ph&ograve;ng ngủ, 1 nh&agrave; vệ sinh</p>\r\n\r\n<p>+ Tầng 4 (125m2): Trước c&oacute; 2 ph&ograve;ng ngủ, chung nh&agrave; vệ sinh. Tầng 4 c&oacute; bếp</p>\r\n\r\n<p>Tất cả c&aacute;c ph&ograve;ng đều đầy&nbsp;đủ tiện nghi</p>\r\n\r\n<p>Nh&agrave; sạch sẽ. tho&aacute;ng m&aacute;t.</p>\r\n\r\n<p>Thu&ecirc; c&oacute; thể kinh doanh mọi ng&agrave;nh nghề: Kinh doanh bu&ocirc;n b&aacute;n, Spa, mở c&ocirc;ng ty, Hommestay, Kh&aacute;ch sạn&nbsp; mini,&nbsp;</p>\r\n\r\n<p>Gia thu&ecirc;: 20&nbsp;triệu ( c&oacute; thượng) cho kh&aacute;ch thiện ch&iacute;. Hợp đồng thu&ecirc; &iacute;t nhất 2 nam</p>\r\n\r\n<div class=\"ddict_btn\" style=\"left:487.328px; top:335px\"><img src=\"chrome-extension://bpggmmljdiliancllaapiggllnkbjocb/logo/48.png\" /></div>\r\n', './image/upload/2-1.jpg', 2, '2023-04-26 23:55:21', '2023-07-09 23:55:21', '1', 2, 26, 2, '2023-04-26 16:55:21', '2023-04-26 16:55:21'),
(66, 'Cho thuê mặt bằng kinh doanh đường Lê Hồng Phong giao Nguyễn Văn Cừ', 'Cho-thue-mat-bang-kinh-doanh-duong-Le-Hong-Phong-giao-Nguyen-Van-Cu', 28, 295, 5262, 'Lê Hồng Phong', '18', 8000000, 42, '<p>Cho thu&ecirc; mặt bằng kinh doanh đường L&ecirc; Hồng Phong giao Nguyễn Văn Cừ</p>\r\n\r\n<p>Ch&iacute;nh chủ cho thu&ecirc; mặt bằng tầng 1, l&agrave;m cửa h&agrave;ng kinh doanh, văn ph&ograve;ng, giao dịch, nail mi, spa, shop thời trang, mỹ phẩm, hiệu s&aacute;ch, quầy thuốc,...</p>\r\n\r\n<p>Vị tr&iacute; ngay ng&atilde; tư giao th&ocirc;ng thuận lợi, mặt tiền 2 hướng</p>\r\n\r\n<p>S&aacute;t b&ecirc;n đường v&agrave;o phố đi bộ</p>\r\n\r\n<p>C&oacute; chỗ để xe thoải m&atilde;i</p>\r\n\r\n<p>Ưu ti&ecirc;n thu&ecirc; mặt bằng l&acirc;u d&agrave;i</p>\r\n\r\n<p>K&yacute; hợp đồng tối thiểu 06 th&aacute;ng</p>\r\n\r\n<p>Tặng ngay 1 th&aacute;ng thu&ecirc; kh&ocirc;ng t&iacute;nh ph&iacute; để set up&nbsp;</p>\r\n', './image/upload/10-chot-10-1561386049095857887463.jpg', 1, '2023-05-01 21:20:36', '2023-07-30 21:20:36', '1', 2, 23, 9, '2023-05-01 14:20:36', '2023-05-01 14:20:36'),
(67, 'Cho thuê căn hộ 3 phòng ngủ ngay cạnh galaxy Vinh', 'Cho-thue-can-ho-3-phong-ngu-ngay-canh-galaxy-Vinh', 28, 295, 5262, 'Lê Hồng Phong', '16', 6000000, 48, '<p>Căn hộ rộng r&atilde;i tho&aacute;ng m&aacute;t, gần ngay rạp chiếu phim galaxy, khu trung t&acirc;m ăn uống vui chơi sầm uất của th&agrave;nh phố vinh</p>\r\n\r\n<p>Gồm 3 ph&ograve;ng ngủ</p>\r\n\r\n<p>1 ph&ograve;ng kh&aacute;ch</p>\r\n\r\n<p>Bếp rộng thoải m&aacute;i nấu ăn</p>\r\n\r\n<p>Ph&ugrave; hợp cho hộ gia đ&igrave;nh c&oacute; con c&aacute;i</p>\r\n\r\n<p>&nbsp;</p>\r\n', './image/upload/10.jpg', 3, '2023-05-05 22:13:15', '2023-07-30 22:13:15', '1', 2, 25, 3, '2023-05-05 15:13:15', '2023-05-05 15:13:15');
